import React from "react";
import { Card, CardDeck } from "react-bootstrap";

const Carddeck = () => {
  const greyTones = [
    "#f2f2f2",
    "#d9d9d9",
    "#bfbfbf",
    "#a6a6a6",
    "#8c8c8c",
    "#737373",
    "#595959",
    "#404040",
    "#262626",
    "#0d0d0d",
  ];

  return (
    <CardDeck>
      {greyTones.map((tone) => (
        <Card key={tone} style={{ backgroundColor: tone }}>
          <Card.Body></Card.Body>
        </Card>
      ))}
    </CardDeck>
  );
};

export default Carddeck;
